import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import OpeningPage from "./components/opening-page";
import Standings from "./components/standings";

function App() {
  return (
    <div className="App">
      <OpeningPage />
      <Standings />
    </div>
  );
}

export default App;
